import React from 'react';
import { Card, CardTitle, CardBody } from 'reactstrap';
import { Link } from 'react-router-dom';

function RenderUserAccounts(account){
  if(account != null){
    return(
          <Card>
            <Link to={`/${account.accountType}`}>
              <CardTitle>{account.accountType}</CardTitle>
              <CardBody>{account.amount}</CardBody>
            </Link>
          </Card>
    )
  }
}

function Home(props) {
    
  const userAccounts = this.props.accounts.accounts.map((account) => {
    return(
      <div className="container">
        <div className="col-6">
          <RenderUserAccounts account={account} />
        </div>
      </div>
    )
  });

  return(
      <div className="container">
        <h4>Home</h4>

      </div>
    );
}

export default Home;
